syntax = "proto3";

package systems.ajax.a911.grpc.v1.hub.main;
option swift_prefix = "Systems";
option java_package = "systems.ajax.a911.grpc.v1.main";
option java_multiple_files = true;

import "v1/hub/main/image_urls.proto";
import "v1/hub/main/name.proto";

message Room {
    string id = 0x02;
    string image_id = 0x09;
    Name name = 1000;
    systems.ajax.a911.grpc.v1.hub.main.ImageUrls image_urls = 1100;
}
